import React from 'react'
import {Link, NavLink} from 'react-router-dom'


const SignedInLinks = () => {
    return (
        <ul className="navbar-nav">
            <li><Link to='/' className="navbar-brand js-scroll-trigger" >Project Tools </Link></li>
            <li><NavLink to='/' className="nav-link">New Project</NavLink></li>
            <li><NavLink to='/' className="nav-link">Log Out</NavLink></li>
            <li><NavLink to='/' className="nav-link" id="logoIn">PT</NavLink></li>
            <li><NavLink to='/' className="nav-link">Sign Up</NavLink></li>
            <li><NavLink to='/' className="nav-link">Login</NavLink></li>
        </ul>
    )
}

export default SignedInLinks;
